import React, { useState, useRef } from 'react';
import axios from 'axios';
import NavBar from './NavBar';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import './css/main.css';
import './css/image-analysis.css';

export default function Imageanalysis() {
  const [selectedImage, setSelectedImage] = useState(null);
  const [previewUrl, setPreviewUrl] = useState(null);
  const [analysisResult, setAnalysisResult] = useState(null);
  const imageInputRef = useRef();
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleImageChange = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    setSelectedImage(file);
    setPreviewUrl(URL.createObjectURL(file));
    setAnalysisResult(null);
    setLoading(true);

    try {
      const formData = new FormData();
      formData.append('file', file);

      const response = await axios.post('http://localhost:8080/analyze/upload', formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
        withCredentials: true,
      });

      setAnalysisResult(response.data);
    } catch {
      toast.error('분석 실패');
    } finally {
      setLoading(false);
    }
  };

  const handleRecommendation = () => {
    if (analysisResult?.predictedClass) {
      navigate(`/cafe-recommend/${analysisResult.predictedClass}`);
    } else {
      navigate('/cafe-recommend/all');
    }
  };

  return (
    <>
      <NavBar />
      <div className="analysis-wrapper">
        <div className="analysis-inner glass-panel">
          <h1 className="analysis-title gradient-text">음식 이미지 분석</h1>
          <div
            className="upload-area modern-upload"
            onClick={() => imageInputRef.current.click()}
            onDragOver={e => e.preventDefault()}
            onDrop={e => {
              e.preventDefault();
              const file = e.dataTransfer.files[0];
              if (file) {
                imageInputRef.current.files = e.dataTransfer.files;
                handleImageChange({ target: { files: e.dataTransfer.files } });
              }
            }}
          >
            {previewUrl ? (
              <img src={previewUrl} alt="preview" className="preview-img rounded" />
            ) : (
              <>
                <p>이미지를 클릭하거나 드래그하여 업로드</p>
                <span className="upload-icon">📤</span>
              </>
            )}
            <input
              type="file"
              accept="image/*"
              ref={imageInputRef}
              onChange={handleImageChange}
              hidden
            />
          </div>

          {loading && <div className="loading-overlay">🔍 분석 중...</div>}

          {analysisResult && (
            <div className="result-section">
              <div className="card result-card">
                <h2 className="card-title">예측 결과</h2>
                <p className="predicted">{analysisResult.food_ko_name}</p>
                <p className="confidence">신뢰도: {(analysisResult.confidence * 100).toFixed(1)}%</p>
              </div>

              <div className="card nutrition-card">
                <h2 className="card-title">영양 정보</h2>
                <div className="nut-grid">
                  <div><strong>칼로리</strong><span>{analysisResult.calories} kcal</span></div>
                  <div><strong>탄수화물</strong><span>{analysisResult.nut_carb} g</span></div>
                  <div><strong>단백질</strong><span>{analysisResult.nut_pro} g</span></div>
                  <div><strong>지방</strong><span>{analysisResult.nut_fat} g</span></div>
                </div>
              </div>

              <div className="button-group">
                <button className="btn primary" onClick={handleRecommendation}>식당 추천</button>
                <button className="btn secondary" onClick={() => navigate('/meal-recommend')}>식단 추천</button>
              </div>
            </div>
          )}
        </div>
      </div>
    </>
  );
}
